var googleMap;
var zoom = "";
var markerOnIcon = "";
var markerOffIcon = "";
var mapLanguage = $('[data-mapLanguage]').attr('data-mapLanguage');

$(document).ready(function(){    
    
    var api = $('[data-api]').attr('data-api');
    if(api){
        $.getScript("https://maps.googleapis.com/maps/api/js?v=3.exp&language=" + mapLanguage + "&key=" + api + "&callback=initMap");
    }
});
function initMap() {
    
    markerOnIcon = $('[data-markeronicon]').attr('data-markeronicon');
    markerOffIcon = $('[data-markerofficon]').attr('data-markerofficon');
    
    zoom = $('[data-zoom]').attr('data-zoom') ? parseInt($('[data-zoom]').attr('data-zoom')) : "15";
    zoom = parseInt(zoom);
    
    var lat = parseFloat($('[data-placeLat]').attr('data-placeLat'));
    var lng = parseFloat($('[data-placeLng]').attr('data-placeLng'));
    
    googleMap = new google.maps.Map(document.getElementById('googleMap'), {
        center: { lat: lat, lng: lng },
        zoom: zoom,
        streetViewControl: false,
        fullscreenControl: false
    });
    
    var marker = new google.maps.Marker({
        position: new google.maps.LatLng(lat, lng),
        //label: (parseInt(k) + 1) + "",
        icon: markerOnIcon,
        map: googleMap
    });
    
    
   
}




